      backgroundColor: theme.palette.common.black,
      color: theme.palette.common.white,
    },
    body: {
      fontSize: 14,
    },
  }))(TableCell);

*/
  return (
    <div>신청되셨습니다. 곧 연락 드리겠습니다.
               We will get back to you soon.

      <Table>
        <TableHead>
          <TableRow>
            <TableCell  className="TableCellStyle">유저(user)</TableCell>
            <TableCell  className="TableCellStyle">신청 서비스(service) </TableCell>
            <TableCell  className="TableCellStyle">가격(price) </TableCell>
            <TableCell  className="TableCellStyle">남은 크레딧(credit left)</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
         <TableRow>
            <TableCell className="TableCellStyle">{user.username}</TableCell>
            <TableCell className="TableCellStyle">{item.itemName} </TableCell>
            <TableCell className="TableCellStyle">{item.price}</TableCell>
              <TableCell className="TableCellStyle">{user.credit-item.price}</TableCell>

          </TableRow>
        </TableBody>
      </Table>
</div>
  )
}






export default Complete
